            "body": "## JIRA 티켓 링크/번호\r\n\r\n- GDF-412\r\n\r\n## PR 목적\r\n\r\n- assets 관련 파일 관리를 shell script로 한 번에 할 수 있도록 변경\r\n\r\n## 변경 사항\r\n\r\n- assets index 파일의 수정하는 shell script를 추가합니다.\r\n- assets의 컴포넌트화 및 icon/index 파일의 수정하는 shell script를 추가합니다.\r\n- 생성되는 파일의 이름을 스네이크 케이스 -> 파스칼 케이스 or 카멜케이스로 자동 변환합니다.\r\n- svg 파일에서 width, height 값을 추출해 컴포넌트에 적용합니다.\r\n\r\n\r\n## 사용법\r\n```bash\r\nyarn assets\r\n```\r\n\r\n## 테스트 방법\r\n- src/styles/img/index.ts 내용 삭제\r\n- src/component/Common/Icon/index.ts 내용 삭제\r\n- src/component/Common/Icon/icons 하위 파일 모두 삭제\r\n- `yarn assets` 후 파일 생성 및 각 index 파일 내용 추가 확인",
