            "body": "## JIRA 티켓 링크/번호\r\n\r\n- https://groundx.atlassian.net/browse/GDF-358\r\n\r\n## PR 목적\r\n\r\n- 오픈월렛 A2A스펙 적용\r\n\r\n## 변경 사항\r\n[A2A컴포넌트들을 리팩토링]\r\n- `FeeTooltip`, `ContractToolTip` 컴포넌트 리팩토링 \r\n    - 함수형으로 수정\r\n    - typescript적용\r\n    - emotion적용\r\n- `A2ACardImage` -> `A2ANFTSection`으로 수정 \r\n    - typescript적용\r\n    - 함수형으로 수정\r\n    - 이미지, collection이름, badge, NFT이름 랜더링\r\n- `A2AAuthPage`\r\n    - 함수형으로 수정 \r\n    - Query적용\r\n- `A2A Send Page `\r\n    - 함수형으로 수정\r\n    - Query적용\r\n    - type별 데이터 설정하는 로직 개선\r\n- `A2ARequestTemplate`\r\n  - typescript적용\r\n  - 버그 수정\r\n- `A2AResultTemplate`\r\n  - typescript적용\r\n  - emotion 적용\r\n  - Klip v4.5.0스펙 수정사항 적용\r\n\r\n[Query, API 및 DTO 작업]\r\n  - A2ASign, A2ASignMessage \r\n    - mutation 추가 \r\n  - DTO형식 맞추기\r\n    - ResponseInterface -> ..Response\r\n    - 관련 사용처 일괄 수정\r\n\r\n[로직 변경]\r\n  - `A2ARoutePage`\r\n    - A2AGetRequest query적용\r\n    - 이에 따라 각 페이지에서 getA2AStore대신 query데이터 사용하도록 수정\r\n    - 요청 type constant값 적용\r\n    - type별 페이지 route시 request_key 전달\r\n\r\n  - `A2ARequestTemplate`\r\n    - badge, collection관련 정보 prop추가\r\n    - NFT 영역 수정\r\n    - 서비스명, NFT명 모두 표시될 수 있도록 스타일수정\r\n\r\n  - `A2AAuthPage`\r\n    - getA2ARequest Query데이터를 queryClient로부터 받아옴\r\n \r\n  - `A2ASendPage`\r\n    - 함수형 변경\r\n    - getA2ARequest Query데이터를 queryClient로부터 받아옴\r\n    - 에러 상황 로직 개선\r\n    - FT/NFT 정보 설정 로직 수정\r\n    - A2ASign/A2ASignMessage를 A2APinPage, CheckOTPPage에서 수행하도록 수정\r\n\r\n  - `A2ASignMessage`\r\n    - getA2ARequest Query데이터를 queryClient로부터 받아옴\r\n    - A2ASign/A2ASignMessage를 A2APinPage, CheckOTPPage에서 수행하도록 수정\r\n\r\n  - `A2APinPage`\r\n    - a2aSign, a2aSignMessage mutation적용\r\n    - error 코드 로직 개선\r\n    - checkPinMutation로직 개선\r\n\r\n  - `CheckOTPPage`\r\n    - a2aSign, a2aSignMessage mutation적용\r\n    - error 코드 A2A관련 로직 추가\r\n\r\n[기타]\r\n  - `CheckPinPage` \r\n    - checkPin API가 불필요하게 호출되는 이슈 수정\r\n    - 이에 따른 failCount표시 로직 개선\r\n\r\n## 스크린샷(optional)\r\n<img width=\"376\" alt=\"Screen Shot 2022-11-11 at 5 06 12 PM\" src=\"https://user-images.githubusercontent.com/51069277/201298826-70103115-108e-4013-8944-5d628c5b0ea6.png\">\r\n<img width=\"385\" alt=\"Screen Shot 2022-11-11 at 4 16 16 PM\" src=\"https://user-images.githubusercontent.com/51069277/201298834-b7510d6f-d4cc-4a5a-8dbd-e3f617c677c5.png\">\r\n<img width=\"389\" alt=\"Screen Shot 2022-11-11 at 4 32 48 PM\" src=\"https://user-images.githubusercontent.com/51069277/201298841-fc778007-8532-4027-9549-f636b29d1052.png\">\r\n<img width=\"389\" alt=\"Screen Shot 2022-11-11 at 4 33 07 PM\" src=\"https://user-images.githubusercontent.com/51069277/201298847-93406eb7-8143-40d3-a069-474b5bd25540.png\">\r\n<img width=\"382\" alt=\"Screen Shot 2022-11-11 at 5 00 58 PM\" src=\"https://user-images.githubusercontent.com/51069277/201298852-879c6f40-2dc4-4953-8773-b5f3bcc1e27a.png\">\r\n<img width=\"388\" alt=\"Screen Shot 2022-11-11 at 5 01 43 PM\" src=\"https://user-images.githubusercontent.com/51069277/201298854-b5fd317a-b5c6-466d-8ce5-77bfca3abc91.png\">\r\n<img width=\"356\" alt=\"Screen Shot 2022-11-11 at 5 02 47 PM\" src=\"https://user-images.githubusercontent.com/51069277/201298857-fbf3438e-5766-40cd-853e-f6c9d27127d4.png\">\r\n<img width=\"375\" alt=\"Screen Shot 2022-11-11 at 5 03 58 PM\" src=\"https://user-images.githubusercontent.com/51069277/201298864-4cabd5b5-644d-4d14-852e-1a437c465acb.png\">\r\n<img width=\"386\" alt=\"Screen Shot 2022-11-11 at 5 03 33 PM\" src=\"https://user-images.githubusercontent.com/51069277/201298870-66793ede-0262-41b7-b815-a35f01cace7f.png\">\r\n<img width=\"369\" alt=\"Screen Shot 2022-11-11 at 5 05 57 PM\" src=\"https://user-images.githubusercontent.com/51069277/201298873-e6a3c838-b7f7-4941-b4a3-a6b719074d06.png\">\r\n\r\n\r\n## 특이사항(optional)\r\n@thatlook 모달쪽 일단 주석처리 및 `todo @Jenny` 해두었습니다.\r\n@previewg ErrorPage표시해야되는 부분 `todo @Matt` 로 표시해두었습니다.",
